const colors = {
  transparent: "transparent", // 0
  red2: "#C02F06", // 1
  red1: "#DD3100", // 2
  red0: "#F70418", // 4
  purple: "#3B0C61", // 5
  brown: "#883434", // 6
  gold: "#A9691D",
  apricot: "#FFA78F",
  pink0: "#FED3DC",
  pink1: "#F699BF"
};

export default colors;
